$(document).ready(function () {
    $("body").queryLoader2({
        backgroundColor: "#f8bf00",
        barHeight: 0,
        minimumTime: 0,
        fadeOutTime: 300,
        onComplete: function () {
            $('#preloader').remove();
            document.querySelector('body').removeAttribute('style');
        },
        onProgress: function () {
            document.querySelector('body').setAttribute('style', 'overflow:hidden');
        }
    });
});
